import { FETCH_TOPAY_SUCCESS } from 'actionTypes';
const R = require('ramda');

const initialState = [];

const shopBask = (state = initialState, { type, payload }) => {
    switch (type) {
        case FETCH_TOPAY_SUCCESS:
            return R.append(payload, state);
        default:
            return state;
    }
};

export default shopBask;